def cocktail_sort(array):
    swaps = 1
    n = len(array)
    start = 0
    end = n - 1
    sorted = False
    while not sorted:
        sorted = True
        for i in range(start, end):
            if array[i] > array[i + 1]:
                (array[i], array[i + 1]) = (array[i + 1], array[i])
                swaps += 1
                sorted = False
        if sorted:
            break
        end -= 1
        for i in range(end - 1, start - 1, -1):
            if array[i] > array[i + 1]:
                (array[i], array[i + 1]) = (array[i + 1], array[i])
                swaps += 1
                sorted = False
        start += 1
        print(f'Iteration {swaps}: {array}')
    return (array, swaps)

